  true,\n\t\"url\": null,\n\t\"notes\": \"The Integrated Postsecondary Education Data
  System, 2009-10 (IPEDS 2009-10), was a study that was part of the Integrated Postsecondary
  Education Data System (IPEDS) program; program data is available since 1980 at <http://nces.ed.gov/ipeds/>.
  IPEDS 2009-10 (http://nces.ed.gov/ipeds/) was a cross-sectional survey designed
  to collect basic data from all postsecondary institutions in the United States and
  the other jurisdictions. Key statistics produced from IPEDS 2009-10 allowed the
  National Center for Education Statistics (NCES) to describe the size of one of the
  nation's largest enterprises--postsecondary education-- in terms of students enrolled,
  degrees and other awards earned, dollars expended, and staff employed. All Title
  IV institutions were required to respond to IPEDS (see Section 490 of the Higher
  Education Amendments of 1992 [P.L. 102-325; 20 U.S.C. ufffd 1070 et seq.]). IPEDS
  allowed other, non-Title IV institutions to participate on a voluntary basis, but
  only about 200 elected to respond.\",\n\t\"owner_org\": \"8c0bc869-1189-4ced-af26-2abd2337b886\",\n\t\"extras\":
